import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import axios from "axios";

const search = "홍대맛집";
const BASE_URL = "http://whrbdnjs33.asuscomm.com:5432";

function ListThree() {

    const [data, setData] = useState([]);

    const api = axios.create({
        baseURL: BASE_URL
    })

    const getFood = api.get("insta_deep/성수맛집", );
    //{ params: { search } });

    useEffect(() => {
        getFood.then((res) => {
            setData(res.data);
        })
    }, []);

    return (
        <>
            {data.map((post) => post.allowed ?
                <Image>
                    <Item src={post.url} />
                </Image>
                : null
            )}
        </>
    )
}

const Item = styled.img`
    width: 256px;
    height: 256px;
    object-fit: cover;
`;

const Image = styled.div`
    width: 256px;
    height: 256px;
    padding: 3px;
`;

export default ListThree;
